import test from 'ava';
import {parse, stringify} from '@aureooms/js-integer-big-endian';
import {Montgomery} from '../../../../../src';
const REPRESENTATION_BASE = 10;
const DISPLAY_BASE = 10;
const fmt = x => x.length <= 40 ? x : x.slice(0,19) + '..' + x.slice(-19);
function macro(t, N, A, B, expected) {
    const n = parse(DISPLAY_BASE, REPRESENTATION_BASE, N);
    const mont = new Montgomery(REPRESENTATION_BASE, n);

    const a = parse(DISPLAY_BASE, REPRESENTATION_BASE, A);
    const b = parse(DISPLAY_BASE, REPRESENTATION_BASE, B);

    const _a = mont.from(a);

    const _c = mont.pow(_a, b);
    const a_ = mont.out(_a);
    const c = mont.out(_c);

    const A_ = stringify(REPRESENTATION_BASE, DISPLAY_BASE, a_, 0, a_.length);
    const B_ = stringify(REPRESENTATION_BASE, DISPLAY_BASE, b, 0, b.length);
    const C = stringify(REPRESENTATION_BASE, DISPLAY_BASE, c, 0, c.length);

    t.is(A, A_);
    t.is(B, B_);
    t.is(expected, C);
}

macro.title = ( _ , N , A , B , expected ) => `pow(${fmt(A)},${fmt(B)}) = ${fmt(expected)} mod ${fmt(N)}` ;

test(`F_2 base ${REPRESENTATION_BASE} throws`, (t) => {
    t.throws(() => new Montgomery(REPRESENTATION_BASE, [2]), {message: /GCD/});
});
